import React, { Component } from 'react';
import '../website.css';
import CodeBase from '../images/codebase_icon.png';
import warren from '../images/warren.JPG';



class Experiences extends Component {

    constructor(props) {
        super(props);
        this.routeToExp = this.routeToExp.bind(this);
    }


    routeToExp() {
        const path = '/experiences';
        this.props.history.push(path);

    }
    render() {
        var experiences = [{img: CodeBase, desc: "wafae"}];

        console.log("rendering exp");
        return (
            <div className="Experiences"> MY EXPERIENCES
<div className="container">
                        {/* <div className="portrait"> */}
                            <img className="image" src={warren} />
                        {/* </div> */}
                        <div className="overlay">
                            <p onClick={()=>this.routeToHome()} className = "text">HOME</p>
                            <p onClick={()=>this.routeToExp()} className = "text">EXPERIENCES</p>
                            <p onClick={()=>this.routeToProj()} className = "text">PROJECTS</p>

                        </div>
                    </div>
                {/* <li> */}
                    {experiences.map((exp) => (
                        <div className = "exp">
                        <img src={exp.img} className = "exp-img"/>
                        <p className = "exp-desc">{exp.desc} </p>
                        </div>
                    )

                    )}
                    {/* </li> */}
            </div>
        );
    }
}

export default Experiences;
